import { createIcon } from "../icon/createIcon";

export const FilterSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="FilterSolidIcon">
    <path d="M12 0 7.5 6.969V12h-3V6.997h-.001L0 0h12z" />
  </svg>,
  "FilterSolid",
  "filter solid"
);
